export const Profesionales = () => {
const [profesional, setProfesional] = useState("")
console.log(profesional)
    const handleSubmit = (e) => {
        e.preventDefault()
        alert("hola")
    }
    return <div className="w-75 m-auto">
        <form onSubmit={handleSubmit}>
            <div className="input-group mb-3">
                <input type="text" onChange={(e) => setProfesional(e.target.value)} className="form-control" placeHolder="Agregue un profesional" aria-label="Default" aria-describedby="inputGroup-sizing-default" />

            </div>
        </form>
    </div>
}
